import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="jumbotron" ><h1 className="text-center"> Memory Game</h1> </div>

      </div>
    );
  }
}

export default App;
